import React, { useState, useEffect, useCallback } from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";
import { Line } from "react-chartjs-2";
import styled from 'styled-components';
import { useNavigate } from "react-router-dom";
import Button from "../components/Button";


const Container = styled.div`
  padding: 50px 30px;
  margin: auto;
  max-width: 1400px;
  background: #f8f4e1;
  border-radius: 20px;
  box-shadow: 0px 4px 10px rgba(0, 0, 0, 0.2);
  display: grid;
  grid-template-columns: 1fr 2fr 1fr;
  gap: 20px;
  min-height: 85vh;
  align-items: stretch;
`;

const Column = styled.div`
  display: flex;
  flex-direction: column;
  gap: 15px;
`;

const CenterColumn = styled(Column)`
  justify-content: space-between;
`;

const RightColumn = styled(Column)`
  justify-content: space-between;
  height: 90%;
`;

const Table = styled.table`
  width: 100%;
  border-collapse: collapse;
  margin: 20px 0;
`;

const Th = styled.th`
  background-color: #4CAF50;
  color: white;
  padding: 12px;
  text-align: left;
`;

const Td = styled.td`
  padding: 12px;
  text-align: left;
  border: 1px solid #ddd;
`;

const ButtonDownload = styled.button`
  background-color: #4CAF50;
  color: white;
  border: none;
  padding: 10px 20px;
  cursor: pointer;
  border-radius: 5px;
`;

const Row = styled.div`
  display: flex;
  justify-content: space-between;
  gap: 20px;
  padding: 20px;
  max-width: 1200px;
  margin: auto;
  background:rgb(239, 5, 5);
  border-radius: 10px;
`;

const categories = ['Temperatura', 'Iluminacion', 'Humedad'];

const initialData = {
    Temperatura: [
      { fecha: '2025-03-01', dato: '23°C' },
      { fecha: '2025-03-02', dato: '22°C' },
      { fecha: '2025-03-03', dato: '24°C' },
    ],
    Iluminacion: [
      { fecha: '2025-03-01', dato: '350 lux' },
      { fecha: '2025-03-02', dato: '300 lux' },
      { fecha: '2025-03-03', dato: '400 lux' },
    ],
    Humedad: [
      { fecha: '2025-03-01', dato: '60%' },
      { fecha: '2025-03-02', dato: '55%' },
      { fecha: '2025-03-03', dato: '70%' },
    ],
  };


  const dataTemp = [

    { fecha: '2025-03-01', dato: '123' },
    { fecha: '2025-03-02', dato: '456' },
    { fecha: '2025-03-03', dato: '789' },

  ];

  
    
  

function Historial() {

    const [selectedCategory, setSelectedCategory] = useState(categories[0]);
    const [filteredData, setFilteredData] = useState(initialData[selectedCategory]);
    const [search, setSearch] = useState('');

    // Función para manejar el cambio de categoría
  const handleCategoryChange = (event) => {
    const category = event.target.value;
    setSelectedCategory(category);
    setFilteredData(initialData[category]);
    };

  // Función para manejar el filtro de búsqueda
  const handleSearchChange = (event) => {
    const query = event.target.value;
    setSearch(query);
    const filtered = initialData[selectedCategory].filter(
      (item) => item.fecha.includes(query) || item.dato.includes(query)
    );
    setFilteredData(filtered);
    };
    

  return (

    <>

    <Header showUserIcon={true} />

    <Container>
        <Row>
        <Column>
            <div>
            <select onChange={handleCategoryChange} value={selectedCategory}>
            {categories.map((category) => (
                <option key={category} value={category}>
                {category}
                </option>
            ))}
            </select>
            </div>
        </Column>
        <Column>
        <Button>Buscar</Button>
        </Column>
        <Column>
        <Button>Descagar - PDF</Button>
        </Column>
        </Row>
        <Row>
        <RightColumn>
        <Table>
        <thead>
          <tr>
            <Th>Fecha</Th>
            <Th>Dato</Th>
          </tr>
        </thead>
        <tbody>
        {filteredData.map((item, index) => (
              <tr key={index}>
                <Td>{item.fecha}</Td>
                <Td>{item.dato}</Td>
              </tr>
            ))}
        </tbody>
      </Table>
      </RightColumn>
      </Row>
    </Container>


    <Footer />

    </>

  );
}

export default Historial;
